import HeaderOnly from "./components/Layout/HeaderOnly";
import Following from "./pages/Following";
import Home from "./pages/Home";
import Upload from "./pages/Upload";

const publicRoutes = [
    {
        path: '/',
        component: Home,
    },
    {
        path: '/following',
        component: Following, 
        // layout: null
    }, 
    {
        path: '/upload',
        component: Upload,
        layout: HeaderOnly
    },
    {
        path: '/explore',
        component: Expolre,
        layout: HeaderOnly
    },
    {
        path: '/upload',
        component: Upload,
        layout: HeaderOnly
    },
]

export {publicRoutes};
